import React, { useState, useEffect } from "react";
import Axios from "axios";
import Action1 from "../../../../assets/icons/Action1.svg";
import Action4 from "../../../../assets/icons/Action4.svg";
import Action5 from "../../../../assets/icons/Action5.svg";
import StaffsEditModal from "./Modal/StaffsEditModal";
import StaffsViewModal from "./Modal/StaffsViewModal";
import DeleteModal from "../../../../components/ConformtaionModal/DeleteModal";

const StaffsTable = () => {
  const [staffs, setStaffs] = useState([]); // Initialize as empty array
  const [showModal, setShowModal] = useState(false);
  const [showModal2, setShowModal2] = useState(false);
  const [showModal3, setShowModal3] = useState(false);

  useEffect(() => {
    // Fetch staff data from API when the component mounts
    Axios.get("http://localhost:8080/staff/all-staff")
      .then((response) => {
        setStaffs(response.data); // Assuming the response data is an array of staff objects
      })
      .catch((error) => {
        console.error("There was an error fetching the staff data!", error);
      });
  }, []);

  const openModal = () => setShowModal(true);
  const closeModal = () => setShowModal(false);
  const openModal2 = () => setShowModal2(true);
  const closeModal2 = () => setShowModal2(false);
  const openModal3 = () => setShowModal3(true);
  const closeModal3 = () => setShowModal3(false);

  return (
    <div className="overflow-x-auto mx-5 my-5 ">
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr className="bg-gray-100">
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Id
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Name
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Age
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Gender
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Address
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Mobile No
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Department
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Date
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Time
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900">
              Status
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900"></th>
          </tr>
        </thead>
        <tbody>
          {staffs && staffs.length > 0 ? (
            staffs.map((staff) => (
              <tr key={staff.id}>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.id}
                </td>
                <td className="flex flex-row items-center py-4 border-b text-sm text-gray-700 text-center">
                  <img
                    src={staff.doctorImage}
                    alt={`${staff.name} Image`}
                    className="w-12 h-12 rounded-full mr-4"
                  />
                  {staff.name}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.age}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.gender}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.address}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.mobNo}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.department}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.date}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.time}
                </td>
                <td className="py-4 border-b text-sm text-gray-700 text-center">
                  {staff.status}
                </td>
                <td className=" py-4 border-b text-sm text-gray-700 text-center">
                  <div className="flex flex-row">
                    <img
                      src={Action1}
                      alt=""
                      className="cursor-pointer"
                      onClick={openModal}
                    />
                    <img
                      src={Action4}
                      alt=""
                      className="cursor-pointer"
                      onClick={openModal2}
                    />
                    <img
                      src={Action5}
                      alt=""
                      className="cursor-pointer"
                      onClick={openModal3}
                    />
                  </div>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="11" className="py-4 text-center text-gray-700">
                No staff data available
              </td>
            </tr>
          )}
        </tbody>
      </table>

      <StaffsViewModal show={showModal} onClose={closeModal} />
      <StaffsEditModal show={showModal2} onClose={closeModal2} />
      <DeleteModal show={showModal3} onClose={closeModal3} />
    </div>
  );
};

export default StaffsTable;
